// rust/encoding/src/lib.rs use serde::{Deserialize, Serialize, Deserializer, Serializer};
use base64::{Engine, engine::general_purpose::STANDARD}; #[derive(Debug, Clone, Default)]
pub struct StdBase64Data(pub Vec<u8>); impl Serialize for StdBase64Data { fn serialize<S: Serializer>(&self, s: S) -> Result<S::Ok, S::Error> { s.serialize_str(&STANDARD.encode(&self.0)) }
} impl<'de> Deserialize<'de> for StdBase64Data { fn deserialize<D: Deserializer<'de>>(d: D) -> Result<Self, D::Error> { let s = String::deserialize(d)?; let bytes = STANDARD.decode(s).map_err(serde::de::Error::custom)?; Ok(StdBase64Data(bytes)) }
}

